staticBinding.value:
$sqlServer = '${DBServerName}' $dbPort='${dbPort}' $dbUserName = '${Username}' $dbPassword = '${Password}' $nodeName = '${targetList}' $customerName='${customerName}' $dbName = '${dbName}' $Platform='${Platform}'
Function getData {
#Write-Host "Connecting to database" $sqlConnection = New-Object System.Data.SqlClient.SqlConnection $sqlCommand = New-Object System.Data.SqlClient.SqlCommand $sqlAdapter = New-Object System.Data.SqlClient.SqlDataAdapter $sqlDataset = New-Object System.Data.DataSet $sqlConnection.ConnectionString ="server=$sqlServer,$dbPort; database=$dbName; User Id=$dbUserName; password=$dbPassword;"
Try { $sqlConnection.Open() #Write-Host "Database is connected" } catch { return "Error: Failed while connecting to database" }
#### checking entry #### $sqlQuery = "select * from NodeSpecificTable where NodeName='$nodeName' AND CustomerName ='$customerName'" $sqlCommand.CommandText = $sqlQuery $sqlAdapter.selectcommand = $sqlCommand $sqlAdapter.selectcommand.connection = $SQLConnection $sqlDataset = New-Object System.Data.DataSet $sqlAdapter.Fill($sqlDataset) | out-null
$dbNodeName= $sqlDataset.Tables[0].NodeName
if($dbNodeName.count -eq 1) { $NodeName= $sqlDataset.Tables[0].NodeName $CustomerName= $sqlDataset.Tables[0].CustomerName $region= $sqlDataset.Tables[0].Region $Diskthreshold= $sqlDataset.Tables[0].Diskthreshold $CPUthreshold= $sqlDataset.Tables[0].CPUthreshold $Memorythreshold= $sqlDataset.Tables[0].Memthreshold $HypervisorType= $sqlDataset.Tables[0].HypervisorType $HypervisorIP= $sqlDataset.Tables[0].HypervisorIP $TemServerIP= $sqlDataset.Tables[0].TemServerIP $SMTPserver= $sqlDataset.Tables[0].SMTPserver $FromMailId= $sqlDataset.Tables[0].FromMailId $cpuTomail= $sqlDataset.Tables[0].CpuTomailId $memTomail= $sqlDataset.Tables[0].MemTomailId $diskTomail= $sqlDataset.Tables[0].DiskTomailId $serviceTomail= $sqlDataset.Tables[0].ServiceTomailId $serverDownTomail= $sqlDataset.Tables[0].ServerDownTomailId
return "$NodeName,$CustomerName,$region,$Diskthreshold,$CPUthreshold,$Memorythreshold,$HypervisorType,$HypervisorIP,$TemServerIP,$SMTPserver,$FromMailId,$cpuTomail,$memTomail,$diskTomail,$serviceTomail,$serverDownTomail"
} elseif($dbNodeName.count -gt 1) { return "Error: Duplicate entries present" } else { return "Error: No entry present" }
#closing sql connection $sqlConnection.Close()
}
$val=getData
if($val -imatch "Error: No entry present") { write-host "Not onboarded"
